import React from 'react';
import './landing.css';

const LandingPage = () => {
  return (
    <div className="landing">
      <h1>Welcome to the Landing Page!</h1>
      <p>Click on the links above to navigate to other pages.</p>
    </div>
  );
};

export default LandingPage;
